import React from 'react';

const Order = (props) => {
let orders;
console.log(props.orderList)
  if ( props.orderList.length === 0 ){

     orders=(
        <h4 className="empty_list">YOU HAVE NO ORDER LIST </h4>
    )
  }else {
     orders =props.orderList.map((order)=>{
        return (
            <div className="headings" key={order.order_id}> 
                <h5 className="order_id"></h5>
                <h5 className="receiver_name"></h5>
                <h5 className="receiver_phone_no"></h5>
                <h5 className="pickup_address"></h5>
                <h5 className="destination_address"></h5>
                <h5 className="order_date"></h5>
                <h5 className="status"></h5>
                <h5 className="c_location"></h5>


            </div>

        )}
        )
  }




    return (
        <div>
         <div className="headings">
                <h5 className="order_id"></h5>
                <h5 className="receiver_name"></h5>
                <h5 className="receiver_phone_no"></h5>
                <h5 className="pickup_address"></h5>
                <h5 className="destination_address"></h5>
                <h5 className="order_date"></h5>
                <h5 className="status"></h5>
                <h5 className="c_location"></h5>


            </div>
           {orders} 
        </div>
    );
}

export default Order;
